import React from "react";
// import { li } from "react-router-dom";

function Navbar() {
  return (
    <>
      <nav className="bg-gray-800 p-4">
        <div className="container mx-auto">
          <li to="/" className="text-white font-bold text-xl">
            Your Logo
          </li>
          <div className="flex">
            <li to="/" className="text-white mx-4">
              Home
            </li>
            <li to="/about" className="text-white mx-4">
              About
            </li>
            <li to="/contact" className="text-white mx-4">
              Contact
            </li>
          </div>
        </div>
      </nav>
      <h1 className=" bg-slate-600 text-red-200 text-center text-[133px] p-9 ">hello </h1>
    </>
  );
}

export default Navbar;
